webpackJsonp([0xdd39425114fe],{2657:function(t,a){t.exports={pathContext:{docHtml:"<h1>glob-parent <a href=\"https://travis-ci.org/es128/glob-parent\"><img src=\"https://travis-ci.org/es128/glob-parent.svg\" alt=\"Build Status\"></a> <a href=\"https://coveralls.io/r/es128/glob-parent?branch=master\"><img src=\"https://img.shields.io/coveralls/es128/glob-parent.svg\" alt=\"Coverage Status\"></a></h1>\n<p>Javascript module to extract the non-magic parent path from a glob string.</p>\n<p><a href=\"https://nodei.co/npm/glob-parent/\"><img src=\"https://nodei.co/npm/glob-parent.png?downloads=true&#x26;downloadRank=true&#x26;stars=true\" alt=\"NPM\"></a>\n<a href=\"https://nodei.co/npm-dl/glob-parent/\"><img src=\"https://nodei.co/npm-dl/glob-parent.png?height=3&#x26;months=9\" alt=\"NPM\"></a></p>\n<h2>Usage</h2>\n<pre><code class=\"language-sh\">npm install glob-parent --save\n</code></pre>\n<pre><code class=\"language-js\">var globParent = require('glob-parent');\n\nglobParent('path/to/*.js'); // 'path/to'\nglobParent('/root/path/to/*.js'); // '/root/path/to'\nglobParent('/*.js'); // '/'\nglobParent('*.js'); // '.'\nglobParent('**/*.js'); // '.'\nglobParent('path/{to,from}'); // 'path'\nglobParent('path/!(to|from)'); // 'path'\nglobParent('path/?(to|from)'); // 'path'\nglobParent('path/+(to|from)'); // 'path'\nglobParent('path/*(to|from)'); // 'path'\nglobParent('path/@(to|from)'); // 'path'\nglobParent('path/**/*'); // 'path'\n\n// if provided a non-glob path, returns the nearest dir\nglobParent('path/foo/bar.js'); // 'path/foo'\nglobParent('path/foo/'); // 'path/foo'\nglobParent('path/foo'); // 'path' (see issue #3 for details)\n</code></pre>\n<h2>Change Log</h2>\n<p><a href=\"https://github.com/es128/glob-parent/releases\">See release notes page on GitHub</a></p>\n<h2>License</h2>\n<p><a href=\"https://raw.github.com/es128/glob-parent/master/LICENSE\">ISC</a></p>",docPath:"argo-ci/node_modules/glob-parent/readme",proj:"argo-ci"}}}});
